$constLang[] = array('const'=>'_VEHICLE_MANAGER_SHOW_IMPORT_WARNING_MESSAG', 'value_const'=>'<strong>CSV&nbsp;IMPORT:</strong><ul>	<li>At the moment the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>	<li>Fields are separated by a pipe character (<strong>&nbsp;|&nbsp;</strong>)</li>	<li>You can import a whole list with just VehicleID by leaving the other fields empty, for example:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Price&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;...&nbsp;|</li>	<li><strong>WARNING:</strong>&nbsp;do not use CSV import if there are Vehicle Reviews present, in that case use full data import!</li></ul><strong>XML&nbsp;IMPORT:</strong><ul>	<li>import in XML формат</li>	<li><strong>WARNING:</strong>&nbsp;do not use XML import if there are Vehicle Reviews present, in that case use full data import!</li><li><strong>WARNING:</strong>&nbsp;associations between vehicles will not be saved!</li>
