$constLang[] = array('const'=>'_VEHICLE_MANAGER_SHOW_EXPORT_WARNING_MESSAG', 'value_const'=>'<strong>CSV&nbsp;EXPORT:</strong><ul>	<li>CSV export will contain all fields for further editing in a text editor or spreadsheet application</li>	<li>Please note that for subsequent import, only the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>	<li>You can also import later including Vehicle Reviews, use FULL export instead!</li><li></ul><strong>XML&nbsp;EXPORT:</strong><ul>	<li>XML export is the preferred way to export vehicles with Vehicle Descriptions</li>	<li>XML export will contain all vehicle details, including Descriptions, ready for later import</li><strong>WARNING:</strong>&nbsp;associations between vehicles will not be saved!</li>
  <li><strong>WARNING:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li></ul><strong>FULL&nbsp;DATA&nbsp;EXPORT:</strong><ul>	<li>This export will export all VehicleManager data and save all fields and entries</li>	<li>You can later use these files to restore your VehicleManager data in full</li>	<li>This subsequent import will overwrite ALL existing entries, so be careful when using it!</li>	<li>To restore all vehicle photos, please restore all files from folder: --components/com_vehiclemanager/photos--!</li>	<li>To restore all vehicle eDocuments, please restore all files from the folder you have set in [Settings Backend] -- [Location of eDocuments]</li></ul>');
